import React from "react";
import ReactDOM from "react-dom";

const images = {
    white: "/assets/logoWhite.png",
    gold: "/assets/logoGold.png",
}

const Hover = props => {
    function over(me) {
        me.currentTarget.src = props.hover;
    }
    function out(me) {
        me.currentTarget.src = props.default;
    }
    return <img src={props.default} onMouseOver={over} onMouseOut={out} alt="M" className="headerImage" height={props.height} />
};

function HeaderHover() {
    return (
            <Hover height={60} default={images.gold} hover={images.white} />
    )
}

const rootElement = document.getElementById("root");
ReactDOM.render(<HeaderHover />, rootElement); 
export default HeaderHover;
